I’ve been to Iceland and Norway in the last few months. Great countries, and I didn’t meet anyone who wanted to join the EU.

@MichelBarnier Did you discuss the citizens' rights of @the3million and @BritishInEurope?

Did Mark Rutte mention that his parliament voted for ringfencing, just like in the UK with @AlbertoCostaMP? 

It's getting serious for us 5 million.

