@MichelBarnier Hebben jullie het over de burgerrechten van @the3million en @BritishInEurope gehad?

Heeft Mark Rutte verteld dat zijn tweede kamer voor ringfencing gestemd heeft, net as in het VK van @AlbertoCostaMP? 

Het wordt ernstig voor ons 5 miljoen.

